def calculate_elo_delta(winner_elo, loser_elo):
  expected_score = winner_elo - loser_elo
  elo_diff = abs(winner_elo - loser_elo)
  elo_diff = min(elo_diff, 999)
  elo_diff += 1 if elo_diff % 2 == 0 else 0
  if winner_elo > loser_elo:
    expected_score = 100 - table[elo_diff]
  else:
    expected_score = table[elo_diff]
  return 10 * (expected_score * 0.01)
